//SPDX-License-Identifier: MIT

pragma solidity ^0.8.12;



contract  UserDetails {


      struct User  {

        string  userId;
        string  first_name;
        string  last_name;
        string  email_id;

      }


      mapping(string => User) public users; 


      User public newUser ;

      uint public length;
      address public owner;


      constructor() {

          owner = msg.sender;
      }

      event userCreated(

          string  userId,
          string first_name,
          string last_name,
          string email_id

      );


      function createNewUser(string memory _id,string memory firstName,string memory lastName,string memory emailId) public  {



          require(bytes(_id).length >0 ,"Id should not be null");

          require(bytes(firstName).length > 0 ,"First Name Required"); 

          require(bytes(lastName).length>0, "Last Name Required");

          require(bytes(emailId).length>0, "Email address Required");

          users[emailId] = User(_id,firstName,lastName,emailId); 


          //Event to indicate user generated

          emit userCreated(_id,firstName,lastName,emailId);

      }




}
